"128":{"department":"ATHLETIC","number":"128","title":"Swimming: Confidence in Water","description":"This class is for individuals who have fear, anxiety or discomfort in water. This class is also designed for individuals who have previously taken beginning swim courses and have had little/no success or who struggle to move through water.  A foundation of basic balance and movement skills will be developed through a series of fundamental water exercises. When safety or balance in the water is in question, so is the ability to move, and to some extent, the ability to breathe comfortably.  As comfort and balance improves, the easier it is to accept breathing and movement skills. The goal is a swimmer who is comfortable and in control in both shallow and deep water. The fundamental skills learned in this course will provide a foundation for learning stroke technique, such as freestyle, in an effortless manner.  Prerequisites: None Goals: To learn to be comfortable in water, shallow and deep. To learn to rely on oneself, as opposed to the bottom, side, lane line or floatation device, for safety in all water environments.","min_units":1,"max_units":1,"gers":[],"primary":[[{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"11:00:00","end":"11:50:00"}]},{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"10:00:00","end":"10:50:00"}]}],[],[{"instructors":[],"meeting-times":[{"days":[false,true,false,true,false],"start":"15:15:00","end":"16:05:00"}]}]]},
"129":{"department":"ATHLETIC","number":"129","title":"Swimming: Beginning","description":"This class is for non-swimmers.  In this class you will learn how to relax in the water, breath effectively, float and tread, swim 3 different strokes (freestyle, backstroke, breaststroke), jump in the water from the deck, use swimming equipment (kickboards, pull buoys, fins) and swim across a 25 year pool.  If you have fear or anxiety in the water, consider taking the ATH 128 Confidence in Water class.  If you can swim across a 25 yard pool, you should take the ATH 131 Intermediate Swim class. Prereq: non-swimmer, unable to swim across a 25 yard pool. Goals:  Learn to be safe and relaxed in shallow and deep water.  Develop ease and efficiency with breathing &amp; swimming strokes.  Be safe and comfortable swimming 25 yards continuously.  FEE. (AU).","min_units":1,"max_units":1,"gers":[],"primary":[[{"instructors":[],"meeting-times":[{"days":[false,true,false,true,false],"start":"14:15:00","end":"15:05:00"}]},{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"12:00:00","end":"12:50:00"}]},{"instructors":[],"meeting-times":[{"days":[false,true,false,true,false],"start":"11:00:00","end":"11:50:00"}]},{"instructors":[],"meeting-times":[{"days":[false,true,false,true,false],"start":"15:15:00","end":"16:05:00"}]}],[],[{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"11:00:00","end":"11:50:00"}]},{"instructors":[],"meeting-times":[{"days":[false,true,false,true,false],"start":"14:15:00","end":"15:05:00"}]},{"instructors":[],"meeting-times":[{"days":[false,true,false,true,false],"start":"11:00:00","end":"11:50:00"}]}]]},
