"131":{"department":"ATHLETIC","number":"131","title":"Swimming: Intermediate","description":"This class is for those who can swim across a 25 yard pool.  In this class you will learn how to: breathe effectively, tread water, dive in from the edge and use swimming equipment (kick boards, pull buoys, hand paddles, fins).  You will be introduced to and gain further development of the 4 competitive swimming strokes (Freestyle, Backstroke, Breaststroke &amp; Butterfly).  An introduction to flipturns and intervals (50 yard repeats) will be taught.  Underwater videotaping and stroke review and analysis will occur.  Prereq:  Ability to swim across a 25 yard pool continuously.  You MUST be comfortable in deep water, if you are uncomfortable in deep water please take ATH 129 Swimming Beginning. Goals:  Develop relaxed, efficient and refined swim strokes, and begin to learn how to use swimming as a form of fitness (i.e. lap swimming, triathlons, masters swimming, open water swims).  Evolve to swim 500 - 1,000 yards per class.  Fee. (AU)","min_units":1,"max_units":1,"gers":[],"primary":[[{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"15:15:00","end":"16:05:00"}]},{"instructors":[],"meeting-times":[{"days":[false,true,false,true,false],"start":"13:15:00","end":"14:05:00"}]},{"instructors":[],"meeting-times":[{"days":[false,true,false,true,false],"start":"12:00:00","end":"12:50:00"}]}],[{"instructors":[],"meeting-times":[{"days":[false,true,false,true,false],"start":"14:15:00","end":"15:05:00"}]},{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"14:15:00","end":"15:05:00"}]}],[{"instructors":[],"meeting-times":[{"days":[false,true,false,true,false],"start":"10:00:00","end":"10:50:00"}]},{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"15:15:00","end":"16:05:00"}]}]]},
"132":{"department":"ATHLETIC","number":"132","title":"Swimming: Advanced","description":"This class is for those who can swim 100 yards freestyle continuously and have had an introduction to backstroke and breaststroke.  In this class you will learn: refinement of the 4 competitive swimming strokes: freestyle, breaststroke, backstroke, butterfly (review/intro) and efficient breathing techniques.  You will gain additional development of flipturns using intervals (100 yard repeats), competitive starts and turns, use of swimming equipment (kick boards, pull buoys, hand paddles, fins) for fitness, and videotaping with review.  Prereq:  Swim 100 yards continuous of freestyle. If you have not had an introduction to Breaststroke or backstroke, we recommend you take ATH 131 Swimming Intermediate. Goals:  Refinement of all 4 competitive strokes, execution of 100 yard interval sets with flipturns (Freestyle, Individual Medley).  Build strong foundation for reaching your swimming fitness goals (i.e. lap swimming, triathlons, masters swimming, open water swimming.)  Evolve to swim 1,000 ¿ 1,500 yards per class.  Fee. (AU).","min_units":1,"max_units":1,"gers":[],"primary":[[{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"14:15:00","end":"15:05:00"}]},{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"13:15:00","end":"14:05:00"}]},{"instructors":[],"meeting-times":[{"days":[false,true,false,true,false],"start":"10:00:00","end":"10:50:00"}]}],[],[]]},
