"190":{"department":"ATHLETIC","number":"190","title":"Introduction to Nutrition","description":"How to optimize nutrition for health and performance. Topics include macronutrients, fad diets, sugar addiction, low-calorie sweeteners, caloric restriction, disease prevention, and nutrition.  Additional credit is available through a lab section ATH 190L. (not required).","min_units":2,"max_units":2,"gers":[],"primary":[[{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"10:00:00","end":"10:50:00"}]}],[{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"10:00:00","end":"10:50:00"}]}],[{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"10:00:00","end":"10:50:00"}]}]]},
"192":{"department":"ATHLETIC","number":"192","title":"Foundations of Mindful Eating","description":"Foundations of Mindful Eating entails the scientific study and the application of mindfulness and health through contemplative and applied practices. Mindfulness is a way of being engaged in our lives with greater emotional and mental balance. This course involves: 1) Participating in dialogue that cultivates shared mindfulness  2) Apply mindfulness skills to your health and greater well being.  These practices aim to develop greater insight, self awareness, and skillful responding.  3) Using mindfulness as way to create collaborative learning.  Collaborative learning at its best is shared mindfulness and our abilities to listen deeply, suspend judgment, and speak authentically.  When do these, we create the conditions for meaningful, mindful dialogue.","min_units":1,"max_units":1,"gers":[],"primary":[[{"instructors":[],"meeting-times":[{"days":[false,false,true,false,false],"start":"18:30:00","end":"20:20:00"}]}],[],[]]},
"193":{"department":"ATHLETIC","number":"193","title":"Lifestyle Fitness Challenge","description":"Lifestyle Fitness Challenge (LFC) is a fun, healthy way to reduce stress and build effective lifestyle habits.  The class is uniquely designed to cater to each individual student&#39;s needs and allows them to focus on areas in their fitness where they want to improve.  By encouraging healthy lifestyle habits, including time management, injury prevention and recovery, indoor and outdoor activities, and a variety of structured daily &quot;quick fix&quot; exercises, many of which don&#39;t require going to the gym, LFC supports and challenges students to balance their minds and bodies in way that taps into their full potential. Each class session will have a reflective as well as a work-out component, and students will be asked to keep a weekly fitness and lifestyle plan.  Based on the &quot;MEDS&quot; philosophy: a holistic program that encompasses Mindfulness, Exercise, Diet, and Sleep; this &quot;Fitness Challenge&quot; comprises both the cognitive/reflective and the physical components of lifestyle improvement. Participants will learn exercises for building cardiovascular health and physical strength, using little to no equipment, along with safe stretching techniques that will allow them to keep fit for the rest of their lives.  Based on the goals and action plan of each individual, the instructor will help them design an exercise and wellness program that will enable them to engage in a variety of lifestyle changes as they take a deeper look into their personal habits and choices regarding their well-being.","min_units":2,"max_units":2,"gers":[],"primary":[[{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"15:45:00","end":"17:15:00"}]}],[],[{"instructors":[],"meeting-times":[{"days":[true,false,true,false,false],"start":"15:45:00","end":"17:15:00"}]}]]},
"196":{"department":"ATHLETIC","number":"196","title":"Practice of Happiness","description":"This class is for each student to explore personal happiness thru applying research- based principles to enhance everyday life.  The goal of the class is to position happiness as the cornerstone of personal wellness, purpose and fulfillment.  Sessions will combine lecture, guided practice, conversation and readings","min_units":1,"max_units":1,"gers":[],"primary":[[{"instructors":[],"meeting-times":[{"days":[false,true,false,false,false],"start":"15:15:00","end":"17:05:00"}]}],[],[{"instructors":[],"meeting-times":[{"days":[false,false,true,false,false],"start":"16:15:00","end":"18:05:00"}]}]]},
